# URL da API (ajuste conforme necessÃ¡rio)
API_URL = "http://localhost:8000"

def criar_base64_teste():
    """
    Cria um base64 de teste com um texto simples para verificar a contagem de tokens.
    """
    # Texto de teste simples
    texto_teste = """Este Ã© um texto de teste para contagem de tokens.
    O Gemini e outros modelos de IA generativa processam entradas e saÃ­das em uma granularidade chamada token.
    Para modelos do Gemini, um token equivale a cerca de quatro caracteres.
    100 tokens equivalem a cerca de 60 a 80 palavras em inglÃªs.
    Este texto deve ter bem menos que 100k tokens.
    """
    
    # Converte para bytes e depois para base64
    texto_bytes = texto_teste.encode('utf-8')
    base64_string = base64.b64encode(texto_bytes).decode('utf-8')
    
    return base64_string

